import { ReactNode } from "react";

interface TaD {
  id: number;
  title: string;
  description: string;
  deleteGoalFunction: () => void;
  children: ReactNode;
}

export default function CG({
  id,
  title,
  description,
  addGoalFunction,
  children,
}: TaD) {
  return (
    <article>
      <div>
        <h2>{id}</h2>
        <h2>{title}</h2>
        <p>{description}</p>
        {children}
      </div>
      <button onClick={() => addGoalFunction()}>Add</button>
    </article>
  );
}
